import React from "react";
import Navbar from "./Navbar";
import Content from "./Content";

function About() {
  return (
    <>
      <Content
        fline="Blockchain Revolution with"
        sline=" BlockEase"
        tline="If you have query about Blockchain Technology then ContactUs"
        b_content="Contactus"
        link="contact"
      />
      
    </>
  );
}

export default About;
